import React, { Component } from 'react';
import './App.css';
import { Bar } from '@nivo/bar';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Bar
          height={900}
          width={900}
          colors="purple_blue_green"
          data = {[
            {
              "value": "very_educated", 
              "percent": 45,
              "percentColor": "#000000",
            },
            {
              "value": "somewhat_educated",
              "percent": 26,
              "percentColor": "#000000",
            },
            {
              "value": "not_too_educated", 
              "percent": 13,
              "percentColor": "#000000",
            },
            {
              "value": "not_at_all_educated", 
              "percent": 15,
              "percentColor": "#000000",
            },
          ]}
          indexBy="value"
          keys={[
            "percent",
          ]}
          margin={{
            "top": 50,
            "right": 130,
            "bottom": 50,
            "left": 60
          }}
          padding={0.3}
          groupMode="grouped"
          borderColor="inherit:darker(1.6)"
          axisBottom={{
              "orient": "bottom",
              "tickSize": 5,
              "tickPadding": 5,
              "tickRotation": 0,
              "legend": "country",
              "legendPosition": "center",
              "legendOffset": 36
          }}
          axisLeft={{
              "orient": "left",
              "tickSize": 5,
              "tickPadding": 5,
              "tickRotation": 0,
              "legend": "food",
              "legendPosition": "center",
              "legendOffset": -40
          }}
          labelSkipWidth={12}
          labelSkipHeight={12}
          labelTextColor="inherit:darker(1.6)"
          animate={true}
          motionStiffness={90}
          motionDamping={15}
        />
      </div>
    );
  }
}

export default App;
